import { Component, OnInit } from '@angular/core';
import { ParticipanteResponse } from '../../models/participantes.interface';
import { PaticipantesService } from '../../services/paticipantes.service';
import { BaseApiResponse } from 'src/app/shared/models/base-api-response.interface';

@Component({
  selector: 'app-sorteo',
  templateUrl: './sorteo.component.html',
  styleUrls: ['./sorteo.component.scss']
})
export class SorteoComponent implements OnInit {

  participantes: ParticipanteResponse[] = []
  constructor(private _participanteServices: PaticipantesService) { }

  ngOnInit(): void {
    this.participantesList();
  }


  participantesList() {
    this._participanteServices.participantesList().subscribe((pa) => {
      this.participantes = pa.data;
    })
  }
}
